import React from 'react';

function Booking() {
function BookingHus1 () {
    var eventMethod = window.addEventListener ? "addEventListener" : "attachEvent";
    var eventer = window[eventMethod];
    var messageEvent = eventMethod == "attachEvent" ? "onmessage" : "message";

    eventer(messageEvent,function(e) {
    if (e.data.indexOf('resize_booking::') != -1) {
        var height = e.data.replace('resize_booking::', '');
        document.getElementById('bookingFrame').style.height = height+'px';
    }
    } ,false);
}

    return (<>

    <main className="layout-infos">
        <div className="text-infos">
            <h1>Hus 1</h1>

            <div>

               <iframe src="https://widget.fewomanager.cloud/booking/4488#R3636" id="bookingFrame" width="90%;" frameborder="0" scrolling="no"></iframe>
            </div>
        </div>

        <div className="text-infos">
           <h1>Hus 2</h1>
           <div>
                <iframe id="booking-hus2" src="https://fewomanager.de/wid-onlinebuchung?&amp;ref=2557&amp;wid=3823" padding="5px 0" width="90%" height="500px" frameborder="0"></iframe>
                </div>
        </div>


   </main> 
   </>)
}
export default Booking;
